import { Outlet } from "react-router-dom";

const LayoutConent = () => {
  return (
    <>
      {/* <!-- Content Wrapper. Contains page content --> */}
      <div className="content-wrapper">
        {/* <!-- Content Header --> */}
        <section class="content-header"></section>
        <Outlet />
      </div>
    </>
  );
};

export default LayoutConent;
